import logo from './logo.svg';
import './App.css';
import Button from '@mui/material/Button';

function App() {
  return (
      <div className="App-header">
          <h1>OTP Generation</h1>

          <Button variant="outlined">Generate New</Button>
          <p>Time Left To Use: </p>
      </div>
  );
}

export default App;
